      out.write("                for (var i = 0; i < week_count; i++) {\n");
      out.write("                    var monday = d1 + i * 7;\n");
      out.write("                    var sunday = monday + 6;\n");
      out.write("\n");
      out.write("                    if (monday < 10) {\n");
      out.write("                        monday = (Array(2).join(0) + monday).slice(-2);\n");
      out.write("                    }\n");
      out.write("                    if (sunday < 10) {\n");
