      out.write("                    var to;\n");
      out.write("                    if (sunday <= dd) {\n");
      out.write("                        to = year + \"/\" + month + \"/\" + sunday;\n");
      out.write("                    } else {\n");
      out.write("                        d.setFullYear(year, month - 1, sunday);\n");
      out.write("                        to = d.getFullYear() + \"/\" + (d.getMonth() + 1) + \"/\" + d.getDate();\n");
